import React from "react";

const Home = () => {
   return (
      <div>
      <section>
         <div className="App App-content">
            <h1>This is the Home Page</h1>
         </div>
         </section>
         <div className="App section">
            <div>
               <h3>The Future of Bid Scoping</h3>
            </div>
         </div>
         <footer>
            <p>Footing Area</p>
         </footer>
      </div>
   );
};

export default Home;
